    return (

        <
        React.Fragment >
        <
        Routes >
        <
        Route path = '/'
        element = { < Home / > }
        /> <
        Route path = '/create'
        element = { < Create / > }
        /> <
        Route path = '/update/:id'
        element = { < Update / > }
        /> <
        Route path = '/about/:id'
        element = { < About / > }
        /> <
        /Routes> <
        /React.Fragment>



    )
}

export default App;
